class FeedItem extends Component {

    render() {
        return (

                <Paper style={{ margin: 16, padding: 16 }}>
                    <a href={this.props.url} target="_blank">
                        <h2>{this.props.title}</h2>
                    </a>
                    <h5>{this.props.description}</h5>
                </Paper>
        )
    }
}

export default FeedItem;
